import React from 'react';

function TopHeader() {
  return (
    <div>
      <h2>This site is a summary of Joel and his movie collection</h2>
      <img src="../img/Joel.jpg" alt="Joel the great"></img>
    </div>
  );
}

export default TopHeader;
